    bezier3Path.addLineToPoint(CGPointMake(group.minX + 0.77368 * group.width, group.minY + 0.60000 * group.height))
    bezier3Path.closePath()
    bezier3Path.miterLimit = 4;
    
    StyleKit.drinksWhiteColor.setFill()
    bezier3Path.fill()
  }
  
}


